    "2015-09-26T20:09:06.400586",nt"name": "noaa-integrated-ocean-and-coastal-mapping-iocm-orthorectified-mosaic-image-tiles-empire-louisia",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains ortho-rectified
    mosaic tiles, created as a product from the NOAA Integrated Ocean and Coastal Mapping
    (IOCM) initiative of the Mississippi - La Place to Venice, specifically Empire,
    LA. The source imagery was acquired on March 13, 2010, March 14, 2010 and March
    15, 2010. The true color images were acquired with an Applanix Digital Sensor System
    (DSS). The ground sample distance (GSD) for each pixel is 0.35 m. The original images
    were acquired at a higher resolution than the final ortho-rectified mosaic. Associated
    data for this region is filed under NODC Accession 0075829.nnOrtho-rectified mosaic
    tiles are an ancillary product of NOAA's Coastal Mapping Program (CMP), created
    through a wider Integrated Ocean and Coastal Mapping initiative to increase support
    for multiple uses of the data.",nt"license_title": null,nt"extras": [{ntt"key":
